import { FC } from "react";
import { Cell } from "../../store";

interface CellListItemProps {
  cell: Cell;
}

const CellListItem: FC<CellListItemProps> = ({ cell }) => {
  let child: JSX.Element;

  return <div>{cell.id}</div>;
};

export default CellListItem;
